    <p>O primeiro passo para idealizar esse tipo de projeto é ter a planta da residência. Com esse material será possível acessar as dimensões exatas do imóvel. Isso é importante para o cumprimento da NBR 54");
                WriteLiteral(@"10, norma que regula as instalações elétricas em baixa tensão.

            Também é preciso entender as necessidades dos moradores da residência para definir os pontos de luz e as tomadas de uso geral (que ligam aparelhos) e específicos (utilizadas para o chuveiro, por exemplo).
            
            Nesse projeto, é preciso calcular a potência total das cargas elétricas (determinada em Watts) de cada cômodo para que seja definido o disjuntor adequado para a instalação.
            
            Segundo o que determina a norma NBR 5410, locais como cozinhas, banheiros, lavanderias que comportam equipamentos de maior potência energética precisam ter um circuito elétrico reservado para cada objeto.
            
            Outro ponto importante é prever o posicionamento dos dutos para proteger o cabeamento elétrico.</p>
    
